INSERT INTO public.ia_sak_kartlegging_tema VALUES (1, 'UTVIKLE_PARTSSAMARBEID', 'Utvikle partsamarbeidet i virksomheten', 'INAKTIV', '2024-07-03', 'Partssamarbeid er essensielt i virksomheter fordi det bidrar til et godt forebyggende arbeidsmiljø og reduksjon av antall tapte dagsverk. Partssamarbeidet anerkjenner og utnytter kompetansen og ansvarsområdene til verneombud, tillitsvalgte og ledere, noe som skaper en "utvidet ledelseskapasitet".', 1);
INSERT INTO public.ia_sak_kartlegging_tema VALUES (3, 'UTVIKLE_PARTSSAMARBEID', 'Utvikle partssamarbeidet i virksomheten', 'INAKTIV', '2024-07-03', 'Partssamarbeid er essensielt i virksomheter fordi det bidrar til et godt forebyggende arbeidsmiljø og reduksjon av antall tapte dagsverk. Partssamarbeidet anerkjenner og utnytter kompetansen og ansvarsområdene til verneombud, tillitsvalgte og ledere, noe som skaper en "utvidet ledelseskapasitet".', 1);
INSERT INTO public.ia_sak_kartlegging_tema VALUES (4, 'UTVIKLE_PARTSSAMARBEID', 'Partssamarbeid', 'AKTIV', '2024-07-03', '', 1);
INSERT INTO public.ia_sak_kartlegging_tema VALUES (2, 'REDUSERE_SYKEFRAVÆR', 'Redusere sykefravær i virksomheten', 'INAKTIV', '2024-07-03', 'Sykefravær er en viktig indikator for arbeidsmiljøet og ansattes helse. Å ha et bevisst forhold til sykefraværsarbeid på arbeidsplassen er avgjørende for å skape et trivelig og produktivt arbeidsmiljø. Gjennom kartlegging kan man identifisere mønstre, sette mål og implementere tiltak for å redusere sykefraværet. Dette bidrar til et bedre arbeidsmiljø og økt trivsel for alle ansatte.', 2);
INSERT INTO public.ia_sak_kartlegging_tema VALUES (5, 'REDUSERE_SYKEFRAVÆR', 'Sykefraværsarbeid', 'AKTIV', '2024-07-03', '', 2);
INSERT INTO public.ia_sak_kartlegging_tema VALUES (6, 'ARBEIDSMILJØ', 'Arbeidsmiljø', 'AKTIV', '2024-07-03', '', 3);
